import{_ as t,o as d,c as e,Q as o}from"./chunks/framework.385ac4c3.js";const m=JSON.parse('{"title":"贡献代码","description":"","frontmatter":{"title":"贡献代码","icon":"creative"},"headers":[],"relativePath":"docs/develop/ContributionCode.md","filePath":"docs/develop/ContributionCode.md"}'),r={name:"docs/develop/ContributionCode.md"},c=o('<h2 id="一、准备工作" tabindex="-1">一、准备工作 <a class="header-anchor" href="#一、准备工作" aria-label="Permalink to &quot;一、准备工作&quot;">​</a></h2><ul><li><p>安装 Git；</p></li><li><p>安装 Sourcetree，这个工具是 git 的一种图形化界面；</p></li><li><p>注意安装 git 的时候记得勾选将 git 所在目录添加到系统环境变量；</p></li></ul><details><summary>1.DotNet项目</summary><p><a href="./backend/">后端开发指南</a></p></details><details><summary>2.Vue项目</summary><p><a href="./frontend/">前端开发指南</a></p></details><h2 id="二、贡献代码" tabindex="-1">二、贡献代码 <a class="header-anchor" href="#二、贡献代码" aria-label="Permalink to &quot;二、贡献代码&quot;">​</a></h2><h3 id="_1-新建自己的分支-fork" tabindex="-1">1. 新建自己的分支（Fork） <a class="header-anchor" href="#_1-新建自己的分支-fork" aria-label="Permalink to &quot;1. 新建自己的分支（Fork）&quot;">​</a></h3><p>将本项目仓库 fork 到自己的 git 仓库中。</p><h3 id="_2-克隆-clone" tabindex="-1">2. 克隆（Clone） <a class="header-anchor" href="#_2-克隆-clone" aria-label="Permalink to &quot;2. 克隆（Clone）&quot;">​</a></h3><p>将已经 fork 的仓库 clone 到自己的本地 PC。</p><h3 id="_3-创建本地分支" tabindex="-1">3. 创建本地分支 <a class="header-anchor" href="#_3-创建本地分支" aria-label="Permalink to &quot;3. 创建本地分支&quot;">​</a></h3><p>如果想要在本项目上做自己的开发，最好创建属于自己的项目分支，如果是直接贡献代码，那么可以直接在 dev 分支上进行操作。</p><h3 id="_4-开发" tabindex="-1">4. 开发 <a class="header-anchor" href="#_4-开发" aria-label="Permalink to &quot;4. 开发&quot;">​</a></h3><ol><li>发现了一个小 Bug 并进行修改。</li><li>在打开的 Issues 中选择功能并进行开发。</li></ol><h3 id="_5-提交-commit" tabindex="-1">5. 提交（Commit） <a class="header-anchor" href="#_5-提交-commit" aria-label="Permalink to &quot;5. 提交（Commit）&quot;">​</a></h3><p>向本地仓库提交 Bug。</p><p>规范：</p><table><thead><tr><th>emoji</th><th>emoji 代码</th><th>commit 说明</th></tr></thead><tbody><tr><td>🎨 (调色板)</td><td><code>:art:</code></td><td>改进代码结构/代码格式</td></tr><tr><td>⚡ (闪电) 🐎 (赛马)</td><td><code>:zap:</code> <code>:racehorse:</code></td><td>提升性能</td></tr><tr><td>🔥 (火焰)</td><td><code>:fire:</code></td><td>移除代码或文件</td></tr><tr><td>🐛 (bug)</td><td><code>:bug:</code></td><td>修复 bug</td></tr><tr><td>🚑 (急救车)</td><td><code>:ambulance:</code></td><td>重要补丁</td></tr><tr><td>✨ (火花)</td><td><code>:sparkles:</code></td><td>引入新功能</td></tr><tr><td>📝 (备忘录)</td><td><code>:memo:</code></td><td>撰写文档</td></tr><tr><td>🚀 (火箭)</td><td><code>:rocket:</code></td><td>部署功能</td></tr><tr><td>💄 (口红)</td><td><code>:lipstick:</code></td><td>更新 UI 和样式文件</td></tr><tr><td>🎉 (庆祝)</td><td><code>:tada:</code></td><td>初次提交</td></tr><tr><td>✅ (白色复选框)</td><td><code>:white_check_mark:</code></td><td>更新测试</td></tr><tr><td>🔒 (锁)</td><td><code>:lock:</code></td><td>修复安全问题</td></tr><tr><td>🍎 (苹果)</td><td><code>:apple:</code></td><td>修复 macOS 下的问题</td></tr><tr><td>🐧 (企鹅)</td><td><code>:penguin:</code></td><td>修复 Linux 下的问题</td></tr><tr><td>🏁 (旗帜)</td><td><code>:checked_flag:</code></td><td>修复 Windows 下的问题</td></tr><tr><td>🤖（机器人）</td><td><code>:robot:</code></td><td>修复 Android 下的问题</td></tr><tr><td>🍏 (绿苹果)</td><td><code>:green_apple:</code></td><td>修复 iOS 下的问题</td></tr><tr><td>🔖 (书签)</td><td><code>:bookmark:</code></td><td>发行/版本标签</td></tr><tr><td>🚨 (警车灯)</td><td><code>:rotating_light:</code></td><td>移除 linter 警告</td></tr><tr><td>🚧 (施工)</td><td><code>:construction:</code></td><td>工作进行中</td></tr><tr><td>👷 (工人)</td><td><code>:construction_worker:</code></td><td>添加 CI 构建系统</td></tr><tr><td>💚 (绿心)</td><td><code>:green_heart:</code></td><td>修复 CI 构建问题</td></tr><tr><td>⬆️ (上升箭头)</td><td><code>:arrow_up:</code></td><td>升级依赖</td></tr><tr><td>⬇️ (下降箭头)</td><td><code>:arrow_down:</code></td><td>降级依赖</td></tr><tr><td>📌 (图钉)</td><td><code>:pushpin:</code></td><td>将依赖项固定到特定版本</td></tr><tr><td>📈 (上升趋势图)</td><td><code>:chart_with_upwards_trend:</code></td><td>添加分析或跟踪代码</td></tr><tr><td>♻️ （回收）</td><td><code>:recycle:</code></td><td>重构代码</td></tr><tr><td>🐳 (鲸鱼)</td><td><code>:whale:</code></td><td>Docker 相关工作</td></tr><tr><td>🌐 (带子午线的地球仪)</td><td><code>:globe_with_meridians:</code></td><td>国际化与本地化</td></tr><tr><td>➕ (加号)</td><td><code>:heavy_plus_sign:</code></td><td>增加一个依赖</td></tr><tr><td>➖ (减号)</td><td><code>:heavy_minus_sign:</code></td><td>减少一个依赖</td></tr><tr><td>🔧 (扳手)</td><td><code>:wrench:</code></td><td>修改配置文件</td></tr><tr><td>🔨 (锤子)</td><td><code>:hammer:</code></td><td>重大重构</td></tr><tr><td>✏️ (铅笔)</td><td><code>:pencil2:</code></td><td>修复 typo</td></tr><tr><td>💩 (粑粑...)</td><td><code>:hankey:</code></td><td>写了辣鸡代码需要优化</td></tr><tr><td>⏪ (倒带)</td><td><code>:rewind:</code></td><td>恢复更改</td></tr><tr><td>🔀 (交叉向右的箭头)</td><td><code>:twisted_rightwards_arrows:</code></td><td>合并分支</td></tr><tr><td>📦 (包裹)</td><td><code>:package:</code></td><td>更新编译的文件或包</td></tr><tr><td>👽 (外星人)</td><td><code>:alien:</code></td><td>由于外部 API 更改而更新代码</td></tr><tr><td>🚚 (货车)</td><td><code>:truck:</code></td><td>移动或者重命名文件</td></tr><tr><td>📄 (正面朝上的页面)</td><td><code>:page_facing_up:</code></td><td>增加或更新许可证书</td></tr><tr><td>💥 (爆炸)</td><td><code>:boom:</code></td><td>引入突破性的变化</td></tr><tr><td>🍱 (铅笔)</td><td><code>:bento:</code></td><td>增加或更新资源</td></tr><tr><td>👌 (OK 手势)</td><td><code>:ok_hand:</code></td><td>由于代码审查更改而更新代码</td></tr><tr><td>♿ (轮椅)</td><td><code>:wheelchair:</code></td><td>改善无障碍交互</td></tr><tr><td>💡 (灯泡)</td><td><code>:bulb:</code></td><td>给代码添加注释</td></tr><tr><td>🍻 (啤酒)</td><td><code>:beers:</code></td><td>醉醺醺地写代码...</td></tr><tr><td>💬 (消息气泡)</td><td><code>:speech_balloon:</code></td><td>更新文本文档</td></tr><tr><td>🗃️ (卡片文件盒)</td><td><code>:card_file_box:</code></td><td>执行与数据库相关的更改</td></tr><tr><td>🔊 (音量大)</td><td><code>:loud_sound:</code></td><td>增加日志</td></tr><tr><td>🔇 (静音)</td><td><code>:mute:</code></td><td>移除日志</td></tr><tr><td>👥 (轮廓中的半身像)</td><td><code>:busts_in_silhouette:</code></td><td>增加贡献者</td></tr><tr><td>🚸 (孩童通行)</td><td><code>:children_crossing:</code></td><td>优化用户体验、可用性</td></tr><tr><td>🏗️ (建筑建造)</td><td><code>:building_construction:</code></td><td>结构变动</td></tr><tr><td>📱 (iPhone)</td><td><code>:iphone:</code></td><td>做响应式设计</td></tr><tr><td>🤡 (小丑脸)</td><td><code>:clown_face:</code></td><td>嘲弄事物（直译，这个没明白）</td></tr><tr><td>🥚 (鸡蛋)</td><td><code>:egg:</code></td><td>增加彩蛋</td></tr><tr><td>🙈 (看不见邪恶)</td><td><code>:see_no_evil:</code></td><td>增加或更改 gitignore</td></tr><tr><td>📸 (照相机闪光灯)</td><td><code>:camera_flash:</code></td><td>增加或更新截图</td></tr><tr><td>⚗️ (蒸馏器)</td><td><code>:alembic:</code></td><td>尝试新东西</td></tr><tr><td>🔍 (放大镜)</td><td><code>:mag:</code></td><td>SEO 优化</td></tr><tr><td>☸️ (船的方向盘)</td><td><code>:wheel_of_dharma:</code></td><td>关于 Kubernetes 的工作</td></tr><tr><td>🏷️ (标签)</td><td><code>:label:</code></td><td>增加类型（FLow、Typescript）</td></tr></tbody></table><h3 id="_6-保持本地仓库最新" tabindex="-1">6. 保持本地仓库最新 <a class="header-anchor" href="#_6-保持本地仓库最新" aria-label="Permalink to &quot;6. 保持本地仓库最新&quot;">​</a></h3><p>在准备发起 Pull Request 之前，需要同步原仓库最新的代码，记得检查目前的项目是否是最新的版本。</p><h3 id="_7-推送到远程仓库-ppush" tabindex="-1">7. 推送到远程仓库（Ppush） <a class="header-anchor" href="#_7-推送到远程仓库-ppush" aria-label="Permalink to &quot;7. 推送到远程仓库（Ppush）&quot;">​</a></h3><p>push 到开发者自己的远程仓库中。</p><h3 id="_8-发起并完成合并请求-pull-request" tabindex="-1">8. 发起并完成合并请求（Pull Request） <a class="header-anchor" href="#_8-发起并完成合并请求-pull-request" aria-label="Permalink to &quot;8. 发起并完成合并请求（Pull Request）&quot;">​</a></h3><p>在 git 仓库中选择自己修改了的分支，点击 create pull request 按钮发起 pull request。</p><h2 id="三、提交代码的一些约定" tabindex="-1">三、提交代码的一些约定 <a class="header-anchor" href="#三、提交代码的一些约定" aria-label="Permalink to &quot;三、提交代码的一些约定&quot;">​</a></h2><p>发起请求成功后，本项目维护人就可以看到你提交的代码。pull request 如果被同意，你的代码就会被合并到仓库中。这样一次 pull request 就成功了。</p><p>至此，我们就完成了一次代码贡献的过程。</p>',26),a=[c];function i(l,n,h,s,u,_){return d(),e("div",null,a)}const b=t(r,[["render",i]]);export{m as __pageData,b as default};
